var tipuesearch = {"pages": [{'title': 'About', 'text': '此內容管理系統以\xa0 https://github.com/mdecourse/cmsimde \xa0作為 submodule 運作, 可以選定對應的版本運作, cmsimde 可以持續改版, 不會影響之前設為 submodule, 使用舊版 cmsimde 模組的內容管理相關運作. \n 利用 cmsimde 建立靜態網誌方法: \n 1. 在 github 建立倉儲, git clone 到近端 \n 2. 參考\xa0 https://github.com/mdecourse/newcms , 加入除了 cmsimde 目錄外的所有內容 \n 以 git submodule add\xa0 https://github.com/mdecourse/cmsimde \xa0cmsimde \n 建立 cmsimde 目錄, 並從 github 取下子模組內容. \n 3.在近端維護時, 更換目錄到倉儲中的 cmsimde, 以 python wsgi.py 啟動近端網際伺服器. \n 動態內容編輯完成後, 以 generate_pages 轉為靜態內容, 以 git add commit 及 push 將內容推到遠端. \n 4. 之後若要以 git clone 取下包含 submodule 的所有內容, 執行: \n git clone --recurse-submodules  https://github.com/mdecourse/newcms.git \n', 'tags': '', 'url': 'About.html'}, {'title': 'Develop', 'text': 'https://github.com/mdecourse/cmsimde \xa0的開發, 可以在一個目錄中放入 cmsimde, 然後將 up_dir 中的內容放到與 cmsimde 目錄同位階的地方, 使用 command 進入 cmsimde 目錄, 執行 python wsgi.py, 就可以啟動, 以瀏覽器 https://localhost:9443\xa0就可以連接, 以 admin 作為管理者密碼, 就可以登入維護內容. \n cmsimde 的開發採用 Leo Editor, 開啟 cmsimde 目錄中的 cmsimde.leo 就可以進行程式修改, 結束後, 若要保留網際內容, 只要將 cmsimde 外部的內容倒回 up_dir 目錄中即可後續對 cmsimde 遠端倉儲進行改版. \n init.py 位於\xa0 up_dir 目錄, 可以設定 site_title 與 uwsgi 等變數. \n', 'tags': '', 'url': 'Develop.html'}, {'title': 'Group member', 'text': 'Repository:\xa0 40623143 \xa0 | Site: \xa0 40623143 \xa0| 4輪小車 Repository: \xa0 40723108 \xa0 | Site: \xa0 40723108 \xa0| 亂數分組程式 Repository: \xa0 40723127 \xa0 | Site: \xa0 40723127 \xa0| 亂數分組程式 Repository: \xa0 40723132 \xa0 | Site: \xa0 40723132 \xa0| 可攜系統 Repository: \xa0 40723133 \xa0 | Site: \xa0 40723133 \xa0|\xa0 亂數分組程式 Repository: \xa0 40723137 \xa0 | Site: \xa0 40723137 \xa0| 可攜系統 Repository: \xa0 40723141 \xa0 | Site: \xa0 40723141 \xa0 |\xa0 可攜系統 Repository: \xa0 40723143 \xa0 | Site: \xa0 40723143 \xa0| 4輪小車 Repository: \xa0 40723144 \xa0 | Site: \xa0 40723144 \xa0| 4輪小車 Repository: \xa0 40723147 \xa0 | Site: \xa0 40723147 \xa0| 亂數分組程式(task leader) Repository: \xa0 40723148 \xa0 | Site: \xa0 40723148 \xa0| 4輪小車 (task leader) Repository: \xa0 40723150 \xa0 | Site: \xa0 40723150   |\xa0 可攜系統(task leader) \n', 'tags': '', 'url': 'Group member.html'}, {'title': '分組討論紀錄', 'text': 'W2 直播討論 \n 問題改善： 1.做好的要拍成影片 2.不管會不會做每周都要推東西，不會做的可以問會做的 3.分組倉儲每個組員都先用fork的，之後會把一些人拉做管理者 4.之後直播都會是我負責開，組員都盡量參與有觀看直播的組員盡量發言 5. https://us.misumi-ec.com/us/incadlibrary/ 這個網頁是要做什麼? \n \n \n W3直播討論 \n W3 直播討論： 目前Project1的進度， task leader 負責整理資料推送到ag2倉儲 (須註明哪個組員提供的資料，commit和內容都須注記) 組員也可以用pullrequest請求資料合併 \n 目前進度: 可攜系統可完成網頁頁面和reveal編輯 亂數分組程式 四輪小車 \n 問題討論: 1.亂數分組程式:取到的數值有重複的問題。 2.Pull request 合併頁面出現錯誤(以解決) 3目前個人網頁尚未建立的組員要趕快建立起來 (40623143,40723127,40723137,40723141,40723143) \n \n', 'tags': '', 'url': '分組討論紀錄.html'}, {'title': 'Project 1', 'text': '', 'tags': '', 'url': 'Project 1.html'}, {'title': '亂數分組', 'text': "Create by 40723147 \n 亂數分組 python 程式 -甲班 \n \n \n import random\ngroupList=[['40723104', '40723107', '40723114', '40723115', '40723118', '40723122', '40723123', '40723140', '40723149', '40723151', '40723153', '40723154', '40723155', '40623143', '40723108', '40723127', '40723132', '40723133', '40723137', '40723141', '40723143', '40723144', '40723147', '40723148', '40723150', '40723103', '40723110', '40723112', '40723120', '40723125', '40723126', '40723128', '40723130', '40723139', '40723142', '40723145', '40723146', '40423155', '40723101', '40723102', '40723106', '40723111', '40723119', '40723121', '40723124', '40723134', '40723135', '40723136', '40723138']]\n \ngroup=groupList[0]\n#將group數列隨機排列\nrandom.shuffle(group)\n#列印數列\nprint(group)\n#列印數列(1~12)\nprint(group[0:12])\n#列印數列(13~24)\nprint(group[12:24])\n#列印數列(25~36)\nprint(group[24:36])\n#列印數列(37~49)\nprint(group[36:49]) \n \n \n 使用python編寫亂數分組程式 \n [Python]-隨機random函數 \n \n \n \n import random \n \n \n 匯入\xa0 隨機random函數 \n \n \n \n groupList=[['40723104', '40723107', '40723114', '40723115', '40723118', '40723122', '40723123', '40723140', '40723149', '40723151', '40723153', '40723154', '40723155', '40623143', '40723108', '40723127', '40723132', '40723133', '40723137', '40723141', '40723143', '40723144', '40723147', '40723148', '40723150', '40723103', '40723110', '40723112', '40723120', '40723125', '40723126', '40723128', '40723130', '40723139', '40723142', '40723145', '40723146', '40423155', '40723101', '40723102', '40723106', '40723111', '40723119', '40723121', '40723124', '40723134', '40723135', '40723136', '40723138']] \n \n \n 定義 groupList=所有修課學生 共49位 \n \n \n \n group=groupList[0] \n \n \n 設定變數group=groupList[0]\xa0 \n \n \n \n random.shuffle(group) \n \n \n 使用 random.shuffle 主要運用在將函數中的順序 打亂 \n \n \n 將函數( group)的順序打亂 \n \n \n \n \n #列印數列\nprint(group)\n#列印數列(1~12)\nprint(group[0:12])\n#列印數列(13~24)\nprint(group[12:24])\n#列印數列(25~36)\nprint(group[24:36])\n#列印數列(37~49)\nprint(group[36:49]) \n \n \n \n \n print 列印運用 \n \n 參考資料: https://nkust.gitbook.io/python/untitled \n \n \n \n 測試1 \n \n \n 標示 1 2 3 4 組 \n \n 簡略談 Dart、 python \n \n \n Dart \n 開放原始碼程式語言 ，由Google主導開發，於2011年10月公開。它的開發團隊由 \n Google Chrome瀏覽器V8引擎團隊的領導者拉爾斯·巴克主持，目標在於成為下一代 \n 結構化Web開發語言。 \n 類似JavaScript ， Dart也是一種物件導向語言 ，但是它採用類別為基的程式設計。它 \n 只允許單一繼承， 語法風格接近C語言。 \n 參考資料: https://zh.wikipedia.org/zh-tw/Dart \n python \n 是一種 廣泛使用 的直譯式、進階程式、通用型程式語言，由吉多·范羅蘇姆創造，第 \n 一版釋出於1991年。可以視之為一種改良（加入一些其他程式語言的優點，如物件 \n 導向）的LISP。 Python的設計哲學強調代碼的可讀性和簡潔的語法 （尤其 \n 是使用空格縮排劃分代碼塊，而非使用大括號或者關鍵詞）。相比於C++或Java， \n Python讓開發者 能夠用更少的代碼表達想法 。不管是小型還是大型程式，該語言都 \n 試圖讓程式的結構清晰明瞭。 \n 參考資料: https://zh.wikipedia.org/zh-tw/Python \n \n", 'tags': '', 'url': '亂數分組.html'}, {'title': '可攜系統', 'text': 'Create Portable Programming System for\xa0Windows 10 Create by 40723150 \n 在可攜系統目錄下先創一個 data 目錄 \n PortableGit： https://git-scm.com/download/win \xa0下載 64-bit Git for Windows Portable 安裝在 data 目錄下 \n MSYS2： https://www.msys2.org/ \xa0下載\xa0msys2-x86_64-20190524.exe 並安裝在 data/msys64 的目錄下 \n python3.8.1： https://www.python.org/downloads/windows/ \xa0 下載 Download Windows x86-64 executable installer 準備安裝 3.8.2 python 解譯器，安裝完成後將完整資料放在 data/py381目錄底下 python pip： 到 https://bootstrap.pypa.io/get-pip.py 頁面，滑鼠右鍵另存新檔到CD2020/data執行 \n python get-pip.py \n \n \n \n SciTE： https://www.scintilla.org/SciTEDownload.html \xa0下載 full 64-bit download，解壓縮檔案至 data/wscite432，就是可以直接執行的 Scite.exe 編輯器，若希望以 UtF-8 編碼開啟文件，就必須啟用 Options 下拉式功能表中的 Global Options File（同\xa0SciTEGlobal.properties 檔案）其中的預設值 code.page=0 （為Windows 內定的 Big-5 編碼）修改設定為 code.page=65001，表示使用使 UTF-8 編碼，若要開啟即時更新內容，將load.on.activate=1 前面的井字號拿掉，就會即時更新了（SciTE 須重啟） 修改成 UTF-8 編碼 修改成即時更新 \n Tiny C Compiler： https://github.com/TinyCC/tinycc \xa0git clone 整個倉儲到 data 目錄下並命名目錄為 tcc \n Jupyterlab： https://github.com/jupyterlab/jupyterlab \xa0pip install jupyterlab==2.0.1 自動執行安裝 \n Fossil SCM： https://www.fossil-scm.org/ \xa0下載 fossil scm 解壓縮後將 fossil.exe 放到 data 目錄下 \n Flutter： https://github.com/flutter/flutter\xa0 \xa0(在 data 目錄底下 git clone https://github.com/flutter/flutter.git -b stable) \n Visual Studio Code： https://github.com/microsoft/vscode \xa0(目前是先安裝，安裝完成後把資料放 data/vscode 目錄下) \n home/home_mdecourse：存放 ssh 的資料和.gitconfig \n tmp：放 clone 下來的倉儲 \n ShareX： https://getsharex.com/downloads/ \n putty： 老師整理的 putty \xa0或 \xa0 個人整理的 putty.7z \n start.bat \n @echo off\nset Disk=y\nsubst %Disk%: "data"\n \n%Disk%:\n \nset HomePath=%Disk%:\\home\nset HomeDrive=%Disk%:\\home\nset Home=%Disk%:\\home\nset USERPROFILE=%Disk%:\\home\n \nREM 將系統 Python 程式的 io 設為 utf-8\nset PYTHONIOENCODING="utf-8"\n \n#REM for putty\n#Set GIT_HOME=%CDisk%:\\portablegit\\bin\\\n#Set GIT_SSH=%Disk%:\\putty\\plink.exe\n \nset PYTHONPATH=%Disk%:\\py382\\DLLs;%Disk%:\\py382\\Lib;%Disk%:\\py382\\Lib\\site-packages;\nset PYTHONHOME=%Disk%:\\py382\n \nset path_python=%Disk%:\\py382;%Disk%:\\py382\\Scripts;\nset path_msys2=%Disk%:\\msys64\\mingw64\\bin;\nset path_git=%Disk%:\\portablegit\\bin;\nset path_tcc=%Disk%:\\tcc;\n \npath=%Disk%:;%path_python%;%path_msys2%;%path_git%;%path_tcc%;\n \nstart /MIN cmd.exe\nstart /MIN cmd.exe\nstart /MIN cmd.exe\nstart /MIN cmd.exe\n \nstart /MIN %Disk%:\\wscite432\\wscite\\SciTE.exe\nstart /MIN %Disk%:\\wscite432\\wscite\\SciTE.exe\n \nExit \n \n \n \n stop.bat \n \n \n @echo off\nset Disk=y\npath=%PATH%;\n\xa0\ntaskkill /IM python.exe /F\ntaskkill /IM pythonw.exe /F\ntaskkill /IM scite.exe /F\n\xa0\nREM 終止虛擬硬碟與目錄的對應\nsubst %Disk%: /D\nREM 關閉 cmd 指令視窗\ntaskkill /IM cmd.exe /F\n\xa0\nEXIT \n \n \n 詳細流程在 W2 頁面 \n 基礎可攜系統 下載 \n 加入webots的可攜系統 下載  \n \n', 'tags': '', 'url': '可攜系統.html'}, {'title': '四輪小車', 'text': "Assignment 1: \n Due March 25, 2020 for class 2a . \n What do you need to know from\xa0 http://www.coppeliarobotics.com/helpFiles/index.html \xa0to implement a four-wheeled robot? \n Assignment 2: \n Due April 22, 2020 for class 2a. \n \n \n According to the material of Topic 0 and Topic 1, can you describe specifically what the mechanical design team need to do for accomplishing Assignment 1's four wheeled robot. \n \n \n What do you need to know from \xa0 https://cyberbotics.com/doc/guide/index \xa0 to implement a four-wheeled robot? \n \n \n Assignment 3: \n Due May 27, 2020 for class 2a. \n According to the reading of Topic 2 and Topic 3, propose a Mechatronic project by using CoppeliaSim or Webots and Onshape. \n CoppeliaSim \xa0 ( download ) \n 具有集成開發環境的機器人模擬器CoppeliaSim基於分佈式控制體系結構：可以通過嵌入式腳本，插件，ROS節點，BlueZero節點，遠程API客戶端或自定義解決方案分別控制每個對象/模型。這使CoppeliaSim非常通用，非常適合多機器人應用。控制器可以用C / C ++，Python，Java，Lua，Matlab，Octave或Urbi編寫。 \n Coppelia Robotics 在 \xa0 CoppeliaSim version history \xa0中提到將不再更新 V-rep\xa0 ,並將精力集中在CoppeliaSim上。CoppeliaSim與V-REP 100％兼容。 它運行速度比V-REP快，並且具有更多功能 。", 'tags': '', 'url': '四輪小車.html'}, {'title': '場景&模型&環境', 'text': 'Scenes \n 場景和模型是CoppeliaSim的主要模擬元素。模型是場景的子元素。一個場景可以包含任何數量的模型 \n Models \n 模型是場景的子元素。除了文件（“ * .ttm”-文件類型）外，模型本身不能存在，也不能通過自身進行模擬。模型必須包含在場景中才能運行 。下圖為scenes & Models 之間的關係: \n \n Environment \n CoppeliaSim中的環境定義了屬於場景但不屬於場景物件的屬性和參數。保存模型時不保存環境屬性和參數，但只有保存場景則會 \n', 'tags': '', 'url': '場景&模型&環境.html'}, {'title': 'Calculation modules', 'text': 'Collision detection \n \n Distance calculation \n \n Inverse kinematics \n \n Dynamics \n CoppeliaSim的動力學模塊當前支持下列四種不同的物理引擎。用戶在任何時候都可以根據自己的仿真需求自由地從一種發動機快速切換到另一種發動機。物理引擎支持如此多樣化的原因是，物理模擬是一項複雜的任務，可以通過不同程度的精度，速度或支持多種功能來實現： \n \n \n \n \n Bullet physics library : \n 一個開源物理引擎，具有3D碰撞檢測，剛體動力學和 soft body dynamics （CoppeliaSim當前不支持該功能）。它用於遊戲和電影的視覺效果。它通常被視為遊戲物理引擎。 \n \n \n Open Dynamics Engine (ODE) : \n一個具有兩個主要組成部分的開源物理引擎：剛體動力學和碰撞檢測。它已在許多應用程序和遊戲中使用。它通常被視為遊戲物理引擎。 \n \n VortexÂ® Studio : \xa0 \n非開源商業物理學引擎，可產生高保真物理模擬。 Vortex提供了大量物理屬性的實際參數（即對應於物理單位），使該引擎既逼真又精確。 Vortex主要用於高性能/高精度工業和研究應用。 CoppeliaSim的Vortex插件基於Vortex Studio，該插件要求每個用戶向CM Labs註冊以獲取免費許可證密鑰。 \n \n Newton Dynamics : \xa0 \nNewton Dynamics是一個跨平台的逼真的物理模擬文庫。它實現了確定性求解器，它不是基於傳統的LCP或 疊代 方法，而是分別具有兩者的穩定性和速度。這項功能使Newton Dynamics不僅成為遊戲的工具，而且還成為任何實時物理模擬的工具。當前的插件執行是BETA版本。 \n \n \n \n \n', 'tags': '', 'url': 'Calculation modules.html'}, {'title': '編寫代碼', 'text': 'CoppeliaSim是高度可定制的模擬器：可以自定義模擬的每個方面。此外，模擬器本身可以進行定制，以使其性能完全符合要求。這可以通過精心設計的應用程序編程接口（API）來實現。支持六種不同的編程或編碼方法，每種方法都具有相對於其他方法的特殊優點&缺點，但所有六種方法都是相互兼容的（即可以同時使用，甚至可以穿插使用）。模型，場景或模擬器本身的控制實體可以位於以下位置： \n \n an\xa0 embedded script \xa0: \n an\xa0 add-on \xa0 or \xa0 the sandbox script \xa0: \n a\xa0 plugin \xa0: \n a\xa0 remote API \xa0: \n a\xa0 ROS node \xa0: \n a\xa0 BlueZero node \xa0: \n \n', 'tags': '', 'url': '編寫代碼.html'}, {'title': '模擬', 'text': '', 'tags': '', 'url': '模擬.html'}, {'title': 'Tutorials', 'text': 'Tutorials \n \n', 'tags': '', 'url': 'Tutorials.html'}, {'title': '紀錄', 'text': '紀錄每週專案(亂數分組紀錄、可攜系統紀錄、四輪小車紀錄)進度 \n', 'tags': '', 'url': '紀錄.html'}, {'title': '亂數分組紀錄', 'text': '', 'tags': '', 'url': '亂數分組紀錄.html'}, {'title': '可攜系統紀錄', 'text': 'W2： 安裝 python, SciTE, Portablegit, msys2,\xa0 Tiny C Compiler,\xa0Jupyterlab, Fossil SCM, Leo Editor 和 Flutter 放入可攜系統(有先放先前的putty和ssh到測試是否可以順利使用ssh改版)。 \n W3： 配置webots到可攜系統上，測試msys2裡建立gcc編譯環境。 \n', 'tags': '', 'url': '可攜系統紀錄.html'}, {'title': '四輪小車紀錄', 'text': '', 'tags': '', 'url': '四輪小車紀錄.html'}]};